import React from 'react'

import './Navbar.scss'

const Navbar = () => {
  return (
    <nav>
      <div>
        <img src='' alt='Logo'/>
      </div>

      <ul>
        {['home', 'about', 'contact', 'work', 'skills'].map((item) => (
          <li key={`link-${item}`}>

          </li>
        ) )}
      </ul>

    </nav>
    //<div>Navbar</div>
  )
}

export default Navbar
